import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/Login.css'
import { ReactComponent as LoginCat } from '../icons/login-cat.svg'

function Login()
{

    const doLogin = async event => 
    {
        event.preventDefault();

        window.location.href = '/';
    };

    return(
        <div id="loginDiv">
            <div id="login-text">
                <div id="login-header">
                    <LoginCat />
                    <span id="inner-title">Login</span><br />
                </div>

                <div id="username-box">
                    <span id="username-title">Username</span><br />
                    <input type="text" id="loginName" /><br />
                </div>

                <div id="password-box">
                <span id="password-title">Password</span><br />
                <input type="password" id="loginPassword" /><br />
                </div>

                <input type="submit" id="loginButton" class="buttons" value = "Login"
                onClick={doLogin} />
                <span id="loginResult"></span>

                <p>Forgot your password? <a href="https://github.com/GabrielFPerez/swiPet"><span>Reset</span></a></p>

            </div>


        </div>
    );
};

export default Login;
